import React from "react";

function curtime()
{
  let time = new Date().toLocaleTimeString();
  console.log(time)
}

function App() {
  return (
    <div className="container">
      <h1>{time}</h1>
      <button onClick={curtime} >Get Time</button>
    </div>
  );
}

export default App;
